import React from "react";
import {
  View,
  Text,
  TextInput,
  StyleSheet,
  TouchableOpacity,
  Button,
} from "react-native";

export default function SearchBar(props) {
  return (
    <View style={styles.container}>
      <TextInput style={styles.searchInp} placeholder="Search products..." />
      {/* <TouchableOpacity style={styles.buttons}><Text>X</Text></TouchableOpacity> */}
      <View style={styles.buttons}>
        <Button title="X"></Button>
        <Button title="S"></Button>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flexDirection: "row",
    margin: 10,
  },
  searchInp: {
    flex:0.7,
    borderWidth: 1,
    borderColor: "#ddd",
    borderRadius: 10,
    paddingHorizontal: 10,
    paddingVertical: 5,
  },
  buttons: {
    flexDirection:"row",
    flex:1,
    padding:10,
    margin:10,
    backgroundColor:"green"
  },
});
